import { Component, OnInit } from '@angular/core';
import { TicketService } from '../../services/ticket.service';
import { Ticket } from '../../interfaces/ticket';
import { LiveAnnouncer } from '@angular/cdk/a11y';
import { AfterViewInit, ViewChild } from '@angular/core';
import { MatSort, Sort, MatSortModule } from '@angular/material/sort';
import { MatTableDataSource, MatTableModule } from '@angular/material/table';
import { MatPaginatorModule, MatPaginator } from '@angular/material/paginator';
import { MatIcon, MatIconModule } from '@angular/material/icon';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';


pdfMake.vfs = pdfFonts.pdfMake.vfs;



export interface TicketInTable {
  id: number,
  price: number,
  event: string,
  buyer: string
}

@Component({
  selector: 'app-search-tickets',
  standalone: true,
  imports: [
    MatTableModule,
    // MatSortModule,
    MatPaginatorModule,
    MatIcon
  ],
  templateUrl: './search-tickets.component.html',
  styleUrl: './search-tickets.component.css'
})
export class SearchTicketsComponent implements OnInit, AfterViewInit {
  displayedColumns: string[] = ['id', 'price', 'event', 'buyer', 'date', 'date-purchased', 'coupon', 'status', 'pdf'];
  dataSource: any;
  tickets: Ticket[] | undefined;
  ticketsInTable: TicketInTable[] = []

  constructor(private ticketService: TicketService) { }

  ngOnInit(): void {
    this.ticketService.getTicketsByUserId()
      .subscribe(tickets => {
        this.tickets = tickets

        for (let t of tickets) {
          this.ticketsInTable.push({
            id: t.id,
            price: t.price,
            event: t.event.name.toString(),
            buyer: t.buyer.username.toString()
          })
        }

        // this.dataSource = new MatTableDataSource<TicketInTable>(this.ticketsInTable);
        this.dataSource = new MatTableDataSource<Ticket>(this.tickets);

      });
  }

  @ViewChild(MatPaginator) paginator!: MatPaginator;


  ngAfterViewInit() {
    this.dataSource.paginator = this.paginator;
  }

  onClickDownload(element: Ticket) {
    console.log(element)

    let dd = {
      content: [
        {
          image: 'data:image/png;base64, ',
          width: 150,
        },
        { text: `Ticket Order Confirmation ID: ${element.id}`, margin: 10, style: 'header' },
        { text: 'This is your ticket and you can enter the event using it, do not share it with anyone', margin: 10 },
        {
          columns: [
            { 
                  style: 'tableExample',
                  table: {
                    widths:[100,130],
                    headerRows: 1,
                    body: [
                      ['Ticket ID:', `${element.id}`],
                      ['Event name: ', `${element.event.name}`],
                      ['Ticket Price', `${element.price}`],
                      ['Event Date:', `${element.event.dateStart}`],
                      ['Doors open:', `${element.event.timeStart}`],
                      ['E-mail', `${element.buyer.username}`],
                      ['Name:', `${element.buyer.firstName} ${element.buyer.lastName}`],
                    ]
                  },
                  layout: 'lightHorizontalLines'       
            },
    
            {
                  image: 'data:image/png;base64,',
                  width: 120,
                  height: 120,
                  margin: 30
              
            },
            { 
              text: ""    
            }
          ]
        },
      ],
      styles: {
        tableExample: {
          fontSize: 12,
          bold: true,
          margin:30
        },
        header: {
          fontSize: 18,
          bold: true
        }
      },
      defaultStyle: {
      }

    };


    pdfMake.createPdf(dd).download('userdata.pdf');

  }


}
